import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

import { LoginComponent } from './login/login.component';
import { MainPageComponent } from './mainpage/mainpage.component';
import { DeminscriComponent } from './deminscri/deminscri.component';


const routes: Routes = [
  { path: '', component: LoginComponent }, // Default route shows the LoginComponent
  { path: 'admin/mainpage', component: MainPageComponent },
  { path: 'form/:item', component: DeminscriComponent },

];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule],
})
export class AppRoutingModule {}
